description:
Verenigde Staten
Animatie / Avontuur
103 minuten

goed

met de stemmen van Tom Hanks, Tim Allen en Joan Cusack

Wanneer Andy gaat studeren en op kamers gaat, komen Woody, Buzz en de rest van hun speelgoedvrienden bij dagopvang Sunnyside 
terecht. Dit lijkt in eerste instantie een gezellige plek, onder leiding van de vriendelijke speelgoedbeer Lotso. Maar het 
dagverblijf blijkt helemaal niet zo prettig en dus willen Woody en de rest zo snel mogelijk weg. Dit schijnt echter nog niet zo 
eenvoudig te zijn...
